import Movie from "./Movie";

class Movies extends Component {
    render() {
        return (
            <>
                {
                    this.props.movie.map((item, idx) => {
                        return (
                           <Movie item={item} idx={idx}/>
                        )
                    })
                }

            </>
        )
    }

}
export default Movie;
